import styled from 'styled-components'

jQuery('#row0').click(function() {
    $(this).toggleClass('orange');
  });

export const CardStyle = styled.div`

    .card {
        background: #1E212A;
        width: 365px;
        height: 190px;
        margin-left: 50px;
        display: flex;
        border-radius: 10px; 
        justify-content: space-between;
        margin-top: 50px;
        cursor: pointer;
        ${CardStyle}:focus & {
            border: 5px solid green;
        }


    }



    .image {
        width: 115px;
        height: 115px;
        background: black;
        margin-top: 12px;
        margin-left: 12px;
        border-radius: 10px;
    }

    .infos {
        margin-right: 115px;
        display: flex;
        flex-direction: column;
        justify-content: space-evenly;
    }

    p {
        margin: 0;
        color: #ffff;
        font-weight: 450;
    }


`

function jQuery(arg0: string) {
    throw new Error('Function not implemented.');
}
